- input: "TEXT\x1CC00466482\x1C.TEXT\x1C\x1CF3A\x1CIn the Third Quarter report several
    PACs were recorded in 11(a) rather than 11(c) and this cannot be undone according
    to support tech.  In regards to Richard Pickens he had a redesignation of the
    $200 to the general after reattribution, but the software won't allow you to do
    so.  In regard to Brent Lowells overage of $70, the money was received in the
    Primary and not the Runoff.  In regards to Cynthia Reilley, her extra $100 was
    redesignated to the general.  Gary Smith had a reattribution to his wife Sharon
    Smith for $2400 September 17, 2010, whose address is 11300 S. Portland, Edmond,
    OK 73003 and is a homemaker.  The PACs in 11(a) rather than 11 (c) are:  Procure
    Treatment Centers Inc, PAC; FAA Managers Association Inc. PAC; OK Assn of General
    Contractors Federal PAC; American Society of Anesthesiologists PAC; American Bankers
    Association PAC; Oklahoma Bankers Assn. PAC; ConocoPhillips Spirit PAC; OGE Energy
